<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>ARC-AGI Complete Dashboard | 400 Puzzles</title>
    <link rel="icon" href="data:image/svg+xml,<svg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 100 100'><text y='.9em' font-size='90'>üß†</text></svg>">
    <style>
        *{margin:0;padding:0;box-sizing:border-box}
        :root{--bg:#0f0c29;--accent:#00ff88;--blue:#00d4ff;--orange:#ff8800;--dim:#666;--card:#1a1a2e}
        body{font-family:system-ui,-apple-system,sans-serif;background:linear-gradient(135deg,#0f0c29,#302b63,#24243e);min-height:100vh;color:#fff}
        .header{background:rgba(0,0,0,.5);padding:20px 30px;position:sticky;top:0;z-index:100;backdrop-filter:blur(10px);border-bottom:1px solid rgba(255,255,255,.1)}
        .header-inner{max-width:1400px;margin:0 auto;display:flex;justify-content:space-between;align-items:center;flex-wrap:wrap;gap:15px}
        .logo{display:flex;align-items:center;gap:12px}
        .logo h1{font-size:22px;background:linear-gradient(90deg,var(--accent),var(--blue));-webkit-background-clip:text;-webkit-text-fill-color:transparent}
        .stats{display:flex;gap:25px;align-items:center}
        .stat{text-align:center}
        .stat-val{font-size:28px;font-weight:700}
        .stat-val.green{color:var(--accent)}
        .stat-val.orange{color:var(--orange)}
        .stat-lbl{font-size:10px;color:var(--dim);text-transform:uppercase}
        .prog{width:200px;height:16px;background:rgba(255,255,255,.1);border-radius:8px;overflow:hidden}
        .prog-fill{height:100%;background:linear-gradient(90deg,var(--accent),var(--blue));transition:width .3s}
        .controls{background:rgba(0,0,0,.3);padding:15px 30px;border-bottom:1px solid rgba(255,255,255,.05)}
        .controls-inner{max-width:1400px;margin:0 auto;display:flex;gap:15px;flex-wrap:wrap;align-items:center}
        .search{flex:1;min-width:200px}
        .search input{width:100%;padding:10px 15px;border:1px solid rgba(255,255,255,.1);border-radius:20px;background:rgba(255,255,255,.05);color:#fff;font-size:14px}
        .search input:focus{outline:none;border-color:var(--accent)}
        .filters{display:flex;gap:8px;flex-wrap:wrap}
        .filter-btn{padding:8px 16px;border:1px solid rgba(255,255,255,.1);border-radius:15px;background:transparent;color:#fff;cursor:pointer;font-size:12px;transition:all .2s}
        .filter-btn:hover,.filter-btn.active{background:rgba(0,255,136,.15);border-color:var(--accent)}
        .filter-btn.solved{border-color:var(--accent)}
        .filter-btn.unsolved{border-color:var(--orange)}
        main{max-width:1400px;margin:0 auto;padding:20px}
        .puzzle-list{display:flex;flex-direction:column;gap:8px}
        .puzzle{background:var(--card);border-radius:10px;overflow:hidden;border:1px solid rgba(255,255,255,.08);transition:all .2s}
        .puzzle.solved{border-left:3px solid var(--accent)}
        .puzzle.unsolved{border-left:3px solid var(--orange)}
        .puzzle-header{padding:12px 16px;cursor:pointer;display:flex;align-items:center;gap:15px;transition:background .2s}
        .puzzle-header:hover{background:rgba(255,255,255,.03)}
        .puzzle-id{font-family:monospace;font-size:13px;color:var(--accent);min-width:80px}
        .puzzle.unsolved .puzzle-id{color:var(--orange)}
        .puzzle-status{font-size:11px;padding:3px 10px;border-radius:10px;min-width:70px;text-align:center}
        .puzzle.solved .puzzle-status{background:rgba(0,255,136,.15);color:var(--accent)}
        .puzzle.unsolved .puzzle-status{background:rgba(255,136,0,.15);color:var(--orange)}
        .puzzle-rule{font-family:monospace;font-size:12px;color:#aaa;flex:1}
        .puzzle-shapes{font-size:11px;color:var(--dim)}
        .puzzle-arrow{color:var(--dim);transition:transform .2s}
        .puzzle.open .puzzle-arrow{transform:rotate(180deg)}
        .puzzle-body{display:none;padding:20px;background:rgba(0,0,0,.2);border-top:1px solid rgba(255,255,255,.05)}
        .puzzle.open .puzzle-body{display:block}
        .example-container{display:flex;gap:30px;align-items:flex-start;flex-wrap:wrap}
        .example-side{flex:1;min-width:200px}
        .example-label{font-size:11px;color:var(--dim);text-transform:uppercase;margin-bottom:10px;letter-spacing:1px}
        .grid-wrap{background:#111;padding:10px;border-radius:8px;display:inline-block}
        .px-grid{display:inline-grid;gap:1px}
        .px{border-radius:1px}
        .solution-box{margin-top:15px;padding:12px;background:rgba(0,255,136,.05);border:1px solid rgba(0,255,136,.2);border-radius:8px}
        .solution-box.pending{background:rgba(255,136,0,.05);border-color:rgba(255,136,0,.2)}
        .solution-label{font-size:10px;color:var(--dim);text-transform:uppercase;margin-bottom:5px}
        .solution-code{font-family:monospace;font-size:13px;color:var(--accent)}
        .solution-box.pending .solution-code{color:var(--orange)}
        .c0{background:#000}.c1{background:#0074D9}.c2{background:#FF4136}.c3{background:#2ECC40}.c4{background:#FFDC00}
        .c5{background:#AAA}.c6{background:#F012BE}.c7{background:#FF851B}.c8{background:#7FDBFF}.c9{background:#870C25}
        footer{text-align:center;padding:30px;color:#444;font-size:12px;border-top:1px solid rgba(255,255,255,.05)}
        footer a{color:var(--accent);text-decoration:none}
        @media(max-width:768px){.stats{gap:15px}.stat-val{font-size:22px}.prog{width:120px}main{padding:10px}}
    </style>
</head>
<body>
    <header class="header">
        <div class="header-inner">
            <div class="logo">
                <span style="font-size:32px">üß†</span>
                <div>
                    <h1>ARC-AGI Complete Dashboard</h1>
                    <p style="font-size:12px;color:var(--dim)">Inference GIF Physics | FunnelFunction LLC</p>
                </div>
            </div>
            <div class="stats">
                <div class="stat"><div class="stat-val green" id="solved-count">20</div><div class="stat-lbl">Solved</div></div>

                <div class="stat"><div class="stat-val green" id="percent">5%</div><div class="stat-lbl">Complete</div></div>
            </div>
        </div>
    </header>
    <div class="controls">
        <div class="controls-inner">
            <div class="search"><input type="text" id="search" placeholder="Search by ID or rule..."></div>
            <div class="filters">
                <button class="filter-btn active" onclick="filterPuzzles('all')">All (400)</button>
                <button class="filter-btn solved" onclick="filterPuzzles('solved')">‚úÖ Solved (20)</button>
                <button class="filter-btn unsolved" onclick="filterPuzzles('unsolved')">‚è≥ Unsolved (380)</button>
            </div>
        </div>
    </div>
    <main>
        <div class="puzzle-list" id="puzzle-list"></div>
    </main>
    <footer>
        <p>Built with <strong>Inference GIF Physics</strong> | <a href="https://github.com/FunnelFunction/0.0_Inference_GIF_Physics">GitHub</a> | <a href="https://funnelfunction.com">FunnelFunction.com</a></p>
        <p style="margin-top:8px">Armstrong Knight & Abdullah Khan</p>
    </footer>

        let currentFilter = 'all';
        let searchTerm = '';
        
        function mkGrid(data, maxSize=150) {
            const rows = data.length, cols = data[0].length;
            const cellSize = Math.min(12, Math.floor(maxSize / Math.max(rows, cols)));
            let h = `<div class="px-grid" style="grid-template-columns:repeat(${cols},${cellSize}px)">`;
            for (let r = 0; r < rows; r++) {
                for (let c = 0; c < cols; c++) {
                    h += `<div class="px c${data[r][c]}" style="width:${cellSize}px;height:${cellSize}px"></div>`;
                }
            }
            return h + '</div>';
        }
        
        function togglePuzzle(id) {
            const el = document.getElementById('puzzle-' + id);
            el.classList.toggle('open');
        }
        
        function renderPuzzles() {
            const filtered = PUZZLES.filter(p => {
                if (currentFilter !== 'all' && p.status !== currentFilter) return false;
                if (searchTerm && !p.id.includes(searchTerm) && !p.rule.includes(searchTerm) && !p.desc.toLowerCase().includes(searchTerm.toLowerCase())) return false;
                return true;
            });
            
            document.getElementById('puzzle-list').innerHTML = filtered.map(p => `
                <div class="puzzle ${p.status}" id="puzzle-${p.id}">
                    <div class="puzzle-header" onclick="togglePuzzle('${p.id}')">
                        <span class="puzzle-id">${p.id}</span>
                        <span class="puzzle-status">${p.status === 'solved' ? '‚úÖ Solved' : '‚è≥ Pending'}</span>
                        <span class="puzzle-rule">${p.rule ? p.rule + ': ' + p.desc : 'Click to analyze'}</span>
                        <span class="puzzle-shapes">${p.in_shape} ‚Üí ${p.out_shape}</span>
                        <span class="puzzle-arrow">‚ñº</span>
                    </div>
                    <div class="puzzle-body">
                        <div class="example-container">
                            <div class="example-side">
                                <div class="example-label">üì• Input (${p.in_shape})</div>
                                <div class="grid-wrap">${mkGrid(p.input)}</div>
                            </div>
                            <div class="example-side">
                                <div class="example-label">üì§ Expected Output (${p.out_shape})</div>
                                <div class="grid-wrap">${mkGrid(p.output)}</div>
                            </div>
                        </div>
                        <div class="solution-box ${p.status === 'solved' ? '' : 'pending'}">
                            <div class="solution-label">${p.status === 'solved' ? '‚úÖ Solution Formula' : '‚è≥ Solution Pending'}</div>
                            <div class="solution-code">${p.status === 'solved' ? p.desc : 'Not yet solved - analyzing pattern...'}</div>
                        </div>
                    </div>
                </div>
            `).join('');
        }
        
        function filterPuzzles(filter) {
            currentFilter = filter;
            document.querySelectorAll('.filter-btn').forEach(b => b.classList.remove('active'));
            event.target.classList.add('active');
            renderPuzzles();
        }
        
        document.getElementById('search').addEventListener('input', (e) => {
            searchTerm = e.target.value.toLowerCase();
            renderPuzzles();
        });
        
        renderPuzzles();
